import React, { useEffect, useState } from 'react';

interface Data {
  id: number;
  message: string;
}

const App: React.FC = () => {
  const [data, setData] = useState<Data | null>(null);

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data[0]));
  }, []);

  return (
    <div>
      <h1>Data from the server:</h1>
      {data ? <p>{data.message}</p> : <p>Loading...</p>}
    </div>
  );
};

export default App;
